INSERT INTO `training_rooms` (`id`, `role_id`, `folder_id`, `order_no`, `type`, `title`, `video_url`, `article_details`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 6, 1, 1, 'video', 'What is Bitcoin?', 'https://www.youtube.com/watch?v=S3uTR-P0ycA', NULL, '2021-11-24 06:41:27', '2021-11-24 06:41:27', NULL),
(2, 6, 1, 2, 'article', 'What Is Bitcoin?', NULL, '<p>Bitcoin is a decentralized <a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.investopedia.com/terms/d/digital-money.asp\">digital currency</a> created in January 2009. It follows the ideas set out in a white paper by the mysterious and pseudonymous Satoshi Nakamoto.12 The identity of the person or persons who created the technology is still a mystery. Bitcoin offers the promise of lower transaction fees than traditional online payment mechanisms do, and unlike government-issued currencies, it is operated by a decentralized authority.</p>', '2021-11-24 06:50:00', '2021-11-24 06:50:54', NULL),
(3, 6, 1, 3, 'article', 'Understanding Bitcoin', NULL, '<figure class=\"image\"><img src=\"http://localhost/eliteempire/public/js/ckfinder/userfiles/files/download(2).jpeg\"><figcaption>Bitcoin</figcaption></figure><p>The Bitcoin system is a collection of computers (also referred to as \"nodes\" or \"miners\") that all run Bitcoin\'s code and store its <a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.investopedia.com/terms/b/blockchain.asp\">blockchain</a>. Figuratively speaking, a blockchain can be thought of as a collection of blocks. In each block is a collection of transactions. Because all of the computers running the blockchain have the same list of blocks and transactions and can transparently see these new blocks as they\'re filled with new Bitcoin transactions, no one can cheat the system.</p>', '2021-11-24 06:58:19', '2021-11-24 06:58:19', NULL),
(4, 6, 1, 4, 'quiz', 'Cryptocurrency', NULL, NULL, '2021-11-27 00:41:21', '2021-11-27 00:41:21', NULL),
(5, 6, 1, 5, 'article', 'Why Ecommerce is the future?', NULL, '<p>In other words, the future of ecommerce will be driven by <strong>increasing convenience</strong> for both merchants and their shoppers, providing rich, compelling shopping experiences, and enabling experiences across channels in a consistent, customer-friendly way. 1. Global ecommerce grows as markets outside of U.S. accelerate adoption of online shopping.</p>', '2021-11-27 01:23:29', '2021-11-27 01:23:29', NULL);
